import React from 'react';
import '../styles.css';

const home = ({navBar}) => { 
    return(<PageSetup generalTitle="Raide Energy" pageTitle="Home">
        {"Nuestra compañía se especializa en la fabricación de generadores eólicos y de paneles fotovoltaicos."}
    </PageSetup>) 
}

export default home;
